}

function Panel (){
    return (
        <div className="flex justify-center bg-blue-50">
            <button className='text-2xl bg-red-600 py-2 px-6 rounded-md mx-2'>Posts</button>
            <button className='text-2xl bg-red-600 py-2 px-6 rounded-md mx-2'>Posts</button>
            <button className='text-2xl bg-red-600 py-2 px-6 rounded-md mx-2'>Posts</button>
        </div>
    )
}

